import React, {Component} from 'react';
import {Todo} from './Todo'

export class TodoList extends Component {

    render() {
        const todo = this.props.todoList;
        const listItems = todo.element.map((element,i) =>
          <li key={i}>
            {element}
          </li>
        );
        return ( 
            <div>
                <ul>{listItems}</ul>
            </div>
        );
    }
}
export default TodoList;
